import React from 'react';
import Todos from './components/Todos';
import './App.css';

class App extends React.Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'Learn code',
        completed: false
      },
      {
        id: 2,
        title: 'Play basketball',
        completed: false
      },
      {
        id: 3,
        title: 'Chat with love',
        completed: false
      }
    ]
  }

  render() {
    return (
      <div className="App">
        <h1>app</h1>
        <Todos todo={this.state.todos}/>
      </div>
    );
  }
}

export default App;
